import React, {Fragment} from 'react'
import Image from './Image'
import Title from './Title'
import ProjectLink from './ProjectLink'

function Projects(props) {
  
  let projects = props.projects.map((proj, i)=>{
    console.log(proj)
    return (
       <div className="short-project-wrapper"
       style={{background: `url('${proj.theme}') no-repeat center center`}} key={i} >
        <div className="projects-wrapper">

          <Image 
            phototeaser={proj.photo.teaser}
            bkgColor={proj.bkgColor}/> 

          <div className="project-text-desc">
            <div className="project-text-wrapper">

              <Title 
                primarycolor={proj.textColors.primary}
                secondarycolor={proj.textColors.secondary}
                title={proj.title}
                shortDesc={proj.shortDesc}/>
              
              <ProjectLink 
                internallinks={proj.projectlinks.internal}
                textcolor={proj.textColor}/>
             
              {/* <div className="project-text-alignright">
                <Link href={`${proj.projectlinks.internal}`}>
                  <a>
                    <button type='button' 
                      className='sub-reveal-container content-center button-wrapper show' >
                      <span className='sub-reveal'
                        style={{color: proj.textColor}}>View project</span>
                    </button>
                  </a>
                </Link>
              </div> */}
            </div>

          </div>

        </div>
      </div>
    )
  })


  return (
    <Fragment>
      {projects}
    </Fragment>
  )
}

export default Projects;
